import './card-styles.css';

const Card = ({ name, email, id}) => {
    return(
        <div className='card-div bg-blue br3 grow ma2 dib pa3'>
            <img src={`https://robohash.org/${id}?size=200x200`} alt="card" />

            <div className='f3'>
                <p className=''>{name}</p>
                <p>{email}</p>
            </div>
        </div>
    )
};

export default Card;
